Verenigde Staten
Animatie / Actie
90 minuten

goed

met de stemmen van Jack Black, Angelina Jolie en Dustin Hoffman

Po's droom is uitgekomen nu hij De Drakenkrijger is en de Vredesvallei beschermt samen met zijn vrienden en andere Kung Fu 
meesters, De Vurige Vijf - Tijger, Kraan, Mantis, Viper en Aap. Zijn heerlijke leventje verandert volledig als er een nare 
tegenstander met een geheim wapen China probeert te veroveren en Kung Fu wil uitroeien. Samen met De Vurige Vijf moet hij China
doorkruisen om deze vijand te overmeesteren. Maar hoe kan Po een wapen ontmantelen dat Kung Fu vernietigt? Hij zal daarvoor 
eerst zijn mysterieuze verleden moeten ontrafelen om vervolgens de juiste krachten uit zichzelf te halen.
